import React from 'react';
import MyTour from './tour/'
const Tours = ({data}) =>{
    return(
        <>
        {            
            data.map(tour => {
                console.log(tour.id);
                return(
                    <div key={tour.id}> 
                        <h3>{tour.name}</h3>
                        <img src={tour.image} alt="" />                                                                      
                    </div>
                )

            })
        }
        </>                
    )
};

export default Tours;
